<p>Hi and thank you for stopping by.&nbsp;</p><p>My name is Marisa Kemp - a multi award-winning cake designer and decorator based in Beckenham, South East London.</p><p>I specialise in bespoke, novelty, intricate fun cakes and toppers with over a decade of experience in advanced techniques such as royal icing, sugar and flower paste, cake lace, pastillage, modelling, sculpting, isomalt and painting.&nbsp;</p><p>I run small and one to one classes. See the <a href="/classes">classes </a>section if you are interested.</p><p>Please look through the galleries to see some of my work. You can get the description of each piece or cake by clicking on each photo.</p><p>My hope is to inspire you to get the cake that you dream of.</p><p>Feel free to get in touch to talk about a cake or course of your choice.</p><p>With love, Marisa.</p><p> </p><p> </p><p> </p><p> </p><p> </p><p> </p><p> </p><p> </p><p> </p><p> </p>


